var e={"announcements-team":{content:"\n",data:{categories:"School-Related",clubLeaders:"Joyce Zheng; Tracy Zhao; Sharnujan Sivanenthira",extraInformation:"",joinInstructions:"General members can join at the beginning of each quad.",meetingTimes:"Varies",name:"VPCI Announcements Team",onlinePlatforms:"",shortDescription:"To spread the messages of clubs, extracurricular activities, Guidance and general information.",staffSupervisor:"Christine Laurin",timeCommitment:"Your commitment will be 1-2 morning/week.",slug:"announcements-team"},isEmpty:!1,excerpt:""},"computer-club":{content:"\n",data:{categories:"STEM, Competition, School-Related",clubLeaders:"YiYi Wu, Vincent Zhang",extraInformation:"",joinInstructions:"Members can join anytime using: https://discord.gg/MYd6NyEhaB",meetingTimes:"Fridays 3:45-4:45 for advanced lessons. Fridays 4:45-5:45 for beginner lessons. Both sessions are on Discord.",name:"Computer Club",onlinePlatforms:"",shortDescription:"Computer Club at VP comprises of members consolidated by mutual ardour in computing. Every week, members rejoice in attaining insight on a robust, unique, yet fundamental programming concept in our beginner or advanced sessions. This knowledge prepares members for the famed Canadian Computing Competition.",staffSupervisor:"Ms. Xie",timeCommitment:"Computer Club runs all year long. Drop-in is not recommended as we progressively cover material, building on past foundations.",slug:"computer-club"},isEmpty:!1,excerpt:""},fbla:{content:"\n",data:{categories:"Business competition",clubLeaders:"Tracy Zhao, Ghajaa Senthilkumaran",extraInformation:"",joinInstructions:"Members can join during the beginning of the school year to end of October. Members will have to sign up on a Google form, that will be on the bio of the FBLA Victoria Park Instagram account.",meetingTimes:"Since FBLA is competition based, meetings are to be scheduled between the trainers and the trainees. For now, meetings will be for around an hour each and meetings will be biweekly.",name:"FBLA",onlinePlatforms:"@vpci.fbla on Instagram",shortDescription:"FBLA is an acronym for Future Business Leaders of America. This club is dedicated to preparing students with the skills necessary to succeed in the business environment through practice business competition cases and presentations.",staffSupervisor:"Johnny Carunanithy",timeCommitment:"Since this club is competition based, time commitment to participate will last until the general member cannot move onto the next level of competition",slug:"fbla"},isEmpty:!1,excerpt:""},"french-club":{content:"\n",data:{categories:"School-Related",clubLeaders:"Tina Li and Amanda Guan",extraInformation:"Everyone is welcome! No prior French knowledge is required.",joinInstructions:"Beginning of new school year",meetingTimes:"Wednesdays at 4pm using Google Meet",name:"French Club",onlinePlatforms:"Instagram page: vpci_frenchcouncil",shortDescription:"French Club helps students improve and engage with the French language. Both academic and fun, our club gives an environment where all French enthusiasts can join and learn from each other.",staffSupervisor:"Mme. Khaikin",timeCommitment:"All year long, once a week for an hour",slug:"french-club"},isEmpty:!1,excerpt:""},"girls-who-code":{content:"\n",data:{categories:"STEM, School-Related",clubLeaders:"Serena Sang, Jessica Zhang, Aileen Sun, and Yiyi Wu",extraInformation:"Everyone (regardless of gender) is welcome to join! No experience is required!",joinInstructions:"Anytime with this form: https://tinyurl.com/gwcvp",meetingTimes:"Tuesdays and Thursdays at 4pm on Google Meets",name:"Girls Who Code - GWC",onlinePlatforms:"Discord - https://discord.gg/vXhJy9AvS2 \nInstagram - @girlswhocodevpci  (https://www.instagram.com/girlswhocodevpci/)",shortDescription:"Our mission is to create a safe, welcoming environment that encourages people to code! Come join us to learn more about computer science and technology!",staffSupervisor:"Ms. Strelkovska",timeCommitment:"At least once every other week, year long",slug:"girls-who-code"},isEmpty:!1,excerpt:""},hosa:{content:"\n",data:{categories:"Competition",clubLeaders:"Edward Li, Nazifa Tasnim, Diya Gupta, Olivia Jing, Angela Yang, Shrika Vejandla",extraInformation:"After the Spring Leadership Conference which occur in late spring, we send out applications for executive positions. So if you are interested in health sciences, you should apply. No experience is required. (Link will be posted later)",joinInstructions:"Members can join through form applications starting at the beginning of the current school year up until the Spring Leadership Conference held in late spring of next year.",meetingTimes:"Whenever convenient for the competitors. No strict schedule.",name:"HOSA",onlinePlatforms:"Facebook: https://www.facebook.com/groups/975564555800275/\nInstagram: @vpci_hosa",shortDescription:"Welcome to HOSA! We are a competitive health science club at VP that aims to prepare students for the 30+ events that are held at the annual Spring Leadership Conference by HOSA Canada.",staffSupervisor:"Ms. Comstock",timeCommitment:"Most of the time, it is the competitorâ€™s responsibility to individually study the material for an event (in other words, the more time you invest, the more successful you will be!) We will accommodate those that require a more instructional approach to the HOSA competition. Our club runs from the beginning of the year up until late spring.",slug:"hosa"},isEmpty:!1,excerpt:""},"linux-club":{content:"\n",data:{categories:"STEM",clubLeaders:"Avaneesh Kulkarni",extraInformation:"No prior experience with Linux necessary! But experienced Linux users are also welcome.",joinInstructions:"Contact a leader via email or Discord to join. New members are always welcome.",meetingTimes:"Thursdays at 5 pm via Jitsi Meet",name:"Linux Club",onlinePlatforms:"",shortDescription:"Learn how to use the Linux operating system and customize it to suit your needs.",staffSupervisor:"Ms Strelkovska and Ms Xie",timeCommitment:"No fixed time commitment necessary, but it is recommended to attend all meetings.",slug:"linux-club"},isEmpty:!1,excerpt:""},"math-club":{content:"\n",data:{categories:"STEM, Competition",clubLeaders:"Avaneesh Kulkarni and Jerry Wang",extraInformation:"All grades welcome! No prerequisite math knowledge necessary but an interest in contest math and a willingness to learn is recommended.",joinInstructions:"Contact a math club leader via email or Discord to join.",meetingTimes:"Tuesdays at 1 pm to 1:45 pm via Google Meet",name:"Math Club",onlinePlatforms:"",shortDescription:"We do contest math problems to prepare for math contests such as COMC, CSMC and Eucild.",staffSupervisor:"Ms Keras and Ms Yeganegi",timeCommitment:"No fixed time commitment required. You are free to skip meetings if you need to. Math Club runs all year long.",slug:"math-club"},isEmpty:!1,excerpt:""},medlife:{content:"\n",data:{categories:"Humanities, Human Rights",clubLeaders:"President: Asmita Banerjee, SLT Officer: Tracy Zhao, Fundraising Officer: Ghajaa Senthilkumaran, Marketing Officer: Aroni Ahmed",extraInformation:"To learn more about MEDLIFE, please visit: https://www.medlifemovement.org/",joinInstructions:"Members will be able to join MEDLIFE VP at the beginning of the school year (during September or October), in which there will be posts on the Instagram page of MEDLIFE VP informing students of the release of an application form for General Members.",meetingTimes:"Monday at 4PM using Zoom (bi-weekly)",name:"Medicine Education and Development for Low Income Families Everywhere at Victoria Park Collegiate Institute (MEDLIFE VP)",onlinePlatforms:"Instagram page for MEDLIFE VP: @medlifevp",shortDescription:"MEDLIFE is a non-profit organization that partners with low-income communities in Latin America and Africa to enhance their access to sustainable and basic resources. We plan to empower the poor in their fight for equal access to healthcare, education, and a safe home!",staffSupervisor:"Olivia Wong",timeCommitment:"We require students who will be able to stay a part of this organization for the entire school year, as the club runs all year long.",slug:"medlife"},isEmpty:!1,excerpt:""},mhac:{content:"\n",data:{categories:"Humanities, Advocacy (Mental Health)",clubLeaders:"Calista Di Bartolomeo, Seema Sharma, Theodore Thompson, Daniel Zhang",extraInformation:"MHAC hosts weekly initiatives such as themed Wellness Wednesdays and Resource Highlights.  We also provide resources, share updates, host giveaways, lead school wide events (i.e. Workshop Day) and partner with other school committees on shared projects.  To better educate ourselves and support each other, members of MHAC engage regularly in workshops, training, conversation and self-care practices that enhance our understanding of the benefits of mental health for everyone.  Our workshops and training sessions are provided by the TDSB and outside organizations. All of our events and campaigns are shared via announcements and social media.  Our goal is to support each other and the VPCI community in their mental health journeys.",joinInstructions:"Members can join by simply attending our meetings, so long as they demonstrate that they can handle the time commitment, demonstrating good listening skills at workshops, and being engaged at our weekly meetings. Fill out the sign-up form that we will provide at the beginning of each year and submit it to us. If the forms are no longer available, one can email a teacher supervisor or co-president of MHAC to ask to join.",meetingTimes:"Thursdays at 5 pm using Google Meet.",name:"Mental Health Awareness Council (MHAC)",onlinePlatforms:"Follow us on Instagram: @mhac.vpci\n\nCheck out our Linktree for mental health resources: https://linktr.ee/MHACVP",shortDescription:"MHAC is a council dedicated to providing a safe and accommodating social/emotional environment for students and faculty at VPCI. We aim to eliminate the stigma surrounding mental health and promote mental wellbeing.",staffSupervisor:"Ms. Bagnoli & Ms. Catenacci",timeCommitment:"The time commitment requires an hour in full council meetings each week plus additional time for planning and executing initiatives such as our Wellness Wednesdays.",slug:"mhac"},isEmpty:!1,excerpt:""},oxfam:{content:"\n",data:{categories:"Social Justice, Human Rights",clubLeaders:"Esther Thomas & Ghajaa Senthilkumaran",extraInformation:"Oxfam is split into 2 separate councils: the Events Council which focuses on hosting and running events, and the Awareness Council, which focuses on researching and spreading awareness on global issues.",joinInstructions:"Through a sign-up sheet at the beginning of the school year!",meetingTimes:"Awareness Council - Friday at 5:30PM, Events Council - Wednesday at 5:30PM",name:"Oxfam",onlinePlatforms:"@oxfam.vicpark",shortDescription:"VP Oxfam is part of a global organization of 20 independent charitable organizations that work together to end global poverty. Here at VP, Oxfam strives to support the organizations goals through spreading awareness, hosting fundraisers, and providing volunteer experiences.",staffSupervisor:"Ms. Arjomand",timeCommitment:"1-2 hours a week (year long)",slug:"oxfam"},isEmpty:!1,excerpt:""},"pride-vp":{content:"\n",data:{categories:"Humanities, Social Justice, Human Rights",clubLeaders:"Nabeeha Rahman, Andrea Maxwell, Xaira Crichlow",extraInformation:"",joinInstructions:"To join Pride VP please fill out the following google form: https://forms.gle/aMS55nSbo3tLA7yi7 . Sign-ups are open throughout the school year.",meetingTimes:"Friday at 5pm using Google Meet",name:"Pride VP",onlinePlatforms:"Check out our Instagram for more information and follow us to stay updated on events: www.instagram.com/pridevp/",shortDescription:"Pride VP is Victoria Park CI's official GSA. Here at Pride, our goal is to spread love and positivity. We work to keep the student body informed and aware of relevant LGBTQ+ events and issues. More importantly, Pride is all about creating a safe space for all students regardless of sexuality or gender identity!",staffSupervisor:"Galya Khaikin",timeCommitment:"Pride VP runs all year long and there is no specific time commitment required to participate. Our goal is to create a safe and welcoming environment for students, so you can come to all our meetings and help plan events, or just drop in occasionally.",slug:"pride-vp"},isEmpty:!1,excerpt:""},"psychology-club":{content:"\n",data:{categories:"STEM",clubLeaders:"Senthurry Maheswaran and Sarah Shahrour",extraInformation:"",joinInstructions:"Students can sign up by filling out the Google Form provided by the club leaders at the beginning of the year. Students can join anytime of the year.",meetingTimes:"Bi-weekly on Fridays at 3:30pm using Google Meet",name:"Psychology Club",onlinePlatforms:"https://www.instagram.com/psychologyvp/",shortDescription:"Psychology Club provides a space for students at Victoria Park with an interest in psychology, sociology and more to explore the social science fields. Members will meet to discuss and teach each other about interesting theories, facts and issues.",staffSupervisor:"Ms. Martyr-Andre",timeCommitment:"Half an hour, every 2 weeks throughout the school year",slug:"psychology-club"},isEmpty:!1,excerpt:""},robotics:{content:"\n",data:{categories:"STEM, Competition, School-Related, Robotics",clubLeaders:"Vincent Zhang",extraInformation:"",joinInstructions:"Members may join anytime. Join with the following google form. We will reach out to you. https://docs.google.com/forms/d/e/1FAIpQLSdBK0Cd8l9pCX08dEQCWPzioxPePD_oT1fmpGc90ZVy3jbIaw/viewform",meetingTimes:"Meeting times change throughout the year depending on season. For example, during build season we have more frequent meetings. During covid, we keep contact through Instagram.",name:"VEX Robotics Team",onlinePlatforms:"",shortDescription:"VPCI's VEX Robotics Team is the perfect place to make wonderful memories, have lots of fun, and learn many new skills (building, electronics, driving, programming, complex programming algorithms, innovative designing, digital designing, mechanics, communication, leadership, gracious professionalism etc.). We build robots and anything else robot related!",staffSupervisor:"Ms. Strelkovska",timeCommitment:"Commitment is strongly recommended as teamwork is one of the key factors of success in robotics.",slug:"robotics"},isEmpty:!1,excerpt:""},vac:{content:"\n",data:{categories:"Arts",clubLeaders:"Nabeeha Rahman, Cindy Yu, Ayeza Ahmed, Anny Wei, Benazir Chowdhury",extraInformation:"",joinInstructions:"Members are highly encouraged to apply at the beginning of the year, but membership is open throughout. Note that an application must be filled out to become a member.",meetingTimes:"Wednesdays at 5PM using Google Meet",name:"Visual Arts Council (VAC)",onlinePlatforms:"@vac_vicpark",shortDescription:"The Visual Arts Council is a space where students can express and share their interest in visual arts within a safe and accepting space. We welcome the creativity and passion that students bring to the council.",staffSupervisor:"Joy Martyr-Andre",timeCommitment:"VAC runs year long. In a typical year, the time commitment is at least 1 hour every week. In a COVID-19 affected year, the time commitment is 1 hour every 2 weeks.",slug:"vac"},isEmpty:!1,excerpt:""},"world-vision":{content:"\n",data:{categories:"Social Justice, Human Rights",clubLeaders:"Zainab Khan",extraInformation:"",joinInstructions:"Members can join at any point of the year, they can join by emailing victoriaparkworldvision@gmail.com and doing any follow up steps.",meetingTimes:"Meeting times are decided using when2meets to best fit member's availability. Meetings are held through Google Meet",name:"World Vision",onlinePlatforms:"https://www.instagram.com/vpciworldvision/",shortDescription:"Victoria Park's World Vision chapter aims to provide opportunities for children, their families and their communities in places where resources are limited. During this unprecedented time of Covid-19, we are working to raise awareness, and host fun activities about different worldly issues.",staffSupervisor:"Ms. Dahlke",timeCommitment:"World Vision runs all year, and the time requirement for it depends on the members preference. Most members dedicate 4-5 hours per month to the club.",slug:"world-vision"},isEmpty:!1,excerpt:""}};export{e as c};
